import React from 'react';
import './App.css';
export default function Footer(props){
    return(
        <footer className='footer'>
            <div className='footer-one'>
                <div style={{paddingLeft:'3opx'}}><p style={{color:'yellow'}}>VicGen<br/>VOS IDEES<br/></p><span>NOS SUCCESS</span></div>
                <div></div>
            </div>
            <div className='footer-two'>
                <p>Email<br/>{props.email}</p>
                <p>Addresse<br/>rue normadin</p>
                <p>Telephone<br/>{props.num}</p>
            </div>
            <p style={{textAlign:'center'}}>COPYRIGHT 20223</p>
        </footer>
    )
}
